// eslint-disable-next-line
import React from "react";
import { Container, Row, Col } from "react-bootstrap";

const Footer = () => {
  return (
    <footer>
      <Container>
        <Row>
          <Col className="text-center py-3"> Copyright &copy; Teach-Me</Col>
        </Row>
      </Container>
    </footer>
  );
};

export default Footer;
